window.bookSummaryJSON = "<p><b>The future just went upside down, when a nascent AI is added against Bethany Anne's wishes.</b> </p> <p>Then, there is David and his issues to take care of, permanently. </p> <p><b>Bethany Anne has <i>had it</i> with terrorists.</b> </p> <p>Not encumbered with law, she seeks only justice for those who were killed in France. </p> <p>New members are added to the team as they continue their efforts to reach for the stars. </p>"; 
